(9, 51, 'Home', 'home', '', '<p style="margin: 0px 0px 1em; padding: 0px; color: #555555; font-family: Arial, sans-serif; line-height: 21.88800048828125px;"><span style="color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;">Sealite is a global manufacturer of marine aids to navigation.</span><br style="box-sizing: border-box; outline: none; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;" /><br style="box-sizing: border-box; outline: none; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;" /><span style="color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;">The company is headquartered in Australia, with manufacturing and office locations in the United States and the United Kingdom.</span><br style="box-sizing: border-box; outline: none; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;" /><br style="box-sizing: border-box; outline: none; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;" /><span style="color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;">The Sealite team is dedicated to servicing the marine industry through the efficient design and production of leading-edge products.</span><br style="box-sizing: border-box; outline: none; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;" /><br style="box-sizing: border-box; outline: none; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;" /><span style="color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;">Through close working relationships, marine authorities and private customers around the globe now trust Sealite to enhance the safety of their operations.</span></p>', '', 1, 0, 0, 12, '2014-03-19 03:08:28', 997, '', '2014-04-10 03:21:17', 997, 0, '0000-00-00 00:00:00', '2014-03-19 03:08:28', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"test","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 24, 0, 0, '', '', 1, 2336, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(10, 54, 'Sealite Moves to Larger Facility in the UK', 'sealite-moves-to-larger-facility-in-the-uk', '', '<p style="box-sizing: border-box; outline: none; margin: 1em 0px; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;"><strong style="box-sizing: border-box; outline: none;">A Sealite Nautilus ocean buoy with 3-5NM+ marine lantern was recently installed at the Scroby Sands Wind Farm, a 100 million+ operational wind farm located in the North Sea, 2.5km off the coast of Great Yarmouth in eastern England.</strong></p>\r\n<p style="box-sizing: border-box; outline: none; margin: 1em 0px; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;">Supplied ex-stock from Sealite United Kingdom in Lowestoft, the Nautilus 2200mm diameter ocean buoy with SL-C410 3-5NM+ solar LED marine lantern was installed to replace an obsolete navigation aid.</p>\r\n<p style="box-sizing: border-box; outline: none; margin: 1em 0px; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;">Scroby Sands Wind Farm is owned and operated by E.ON Climate &amp; Renewables, the worlds 3rd largest company in offshore wind energy. Each year the 30 operational wind turbines produce over 170 million kWh; enough energy to supply over 40,000 homes. Each wind turbine towers 60 metres above sea level (hub height) with three 40 metre rotating blades.</p>\r\n<p style="box-sizing: border-box; outline: none; margin: 1em 0px; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;">The North Sea has some of the busiest shipping lanes in the world, and with on-going development of energy resources in the area, reliable aids to navigation are imperative for improved safety of life at sea, as well as asset protection.</p>\r\n<p style="box-sizing: border-box; outline: none; margin: 1em 0px; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;">Sealite has a long history of supplying marine navigation aids to protect the valuable offshore wind farm assets of UK and Europe.</p>\r\n<p style="box-sizing: border-box; outline: none; margin: 1em 0px; color: #1c1c1c; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 22.399999618530273px;">To discuss how Sealite UK can assist in your next project, contact Business Development Manager,<br style="box-sizing: border-box; outline: none;" />Mr. Chris Newell on<a href="mailto:c.newell@sealite.com" style="box-sizing: border-box; outline: none; color: #414141; text-decoration: underline;">c.newell@sealite.com</a> or phone +44 (0) 1502 588026 or +44 (0) 7769 204182.</p>', '', 1, 0, 0, 14, '2014-03-24 05:11:13', 997, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2014-03-24 05:11:13', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 0, '', '', 1, 9, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(11, 55, 'Sales Training Module - SL07, SLC310 & SLC410 (2)', 'sales-training-module-sl07-slc310-slc410-2', '', '<p>The Sealite Lantern Sales Training Module includes latest product information, product application &amp; features matrix, industry comparisons, and selling &amp; benefits.</p>\r\n<h3>What next?</h3>\r\n<ul>\r\n<li><strong>Purchase demonstration units to add to your sales kit</strong></li>\r\n<li><strong>Personal Training</strong> - download the presentation &amp; familiarise yourself with the content</li>\r\n<li><strong>In-House Staff Sales Training</strong> - present &amp; demostrate to your sales team</li>\r\n<li><strong>Customer Presentations</strong> - modify &amp; present specific sections of this presentation to your own dealer network &amp; key customers</li>\r\n</ul>', '', 1, 0, 0, 11, '2014-03-18 09:27:24', 997, '', '2014-03-18 13:04:00', 0, 0, '0000-00-00 00:00:00', '2014-03-18 09:27:24', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 0, 1, '', '', 1, 8, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
