(297, 'COM_USERS_EMAIL_ACTIVATE_WITH_ADMIN_ACTIVATION_BODY', 'Hello administrator,\\n\\nA new user has registered at %s.\\nThe user has verified his email, and requests that you approve his account.\\nThis email contains their details:\\n\\n  Name :  %s \\n  email:  %s \\n Username:  %s \\n\\nYou can activate the user by clicking on the link below:\\n %s \\n', '/Applications/XAMPP/xamppfiles/htdocs/sealite/language/en-GB/en-GB.com_users.ini'),
