(299, 'COM_USERS_EMAIL_ACTIVATED_BY_ADMIN_ACTIVATION_BODY', 'Hello %s,\\n\\nYour account has been activated by an administrator. You can now login at %s using the username %s and the password you chose while registering.', '/Applications/XAMPP/xamppfiles/htdocs/sealite/language/en-GB/en-GB.com_users.ini'),
