(301, 'COM_USERS_EMAIL_PASSWORD_RESET_BODY', 'Hello,\\n\\nA request has been made to reset your %s account password. To reset your password, you will need to submit this verification code in order to verify that the request was legitimate.\\n\\nThe verification code is %s\\n\\nClick on the URL below to enter the verification code and proceed with resetting your password.\\n\\n %s \\n\\nThank you.', '/Applications/XAMPP/xamppfiles/htdocs/sealite/language/en-GB/en-GB.com_users.ini'),
(302, 'COM_USERS_EMAIL_PASSWORD_RESET_SUBJECT', 'Your %s password reset request', '/Applications/XAMPP/xamppfiles/htdocs/sealite/language/en-GB/en-GB.com_users.ini'),
