(304, 'COM_USERS_EMAIL_REGISTERED_NOTIFICATION_TO_ADMIN_BODY', 'Hello administrator, \\n\\nA new user ''%s'', username ''%s'', has registered at %s.', '/Applications/XAMPP/xamppfiles/htdocs/sealite/language/en-GB/en-GB.com_users.ini'),
(305, 'COM_USERS_EMAIL_REGISTERED_WITH_ACTIVATION_BODY', 'Hello %s,\\n\\nThank you for registering at %s. Your account is created and must be activated before you can use it.\\nTo activate the account click on the following link or copy-paste it in your browser:\\n%s \\n\\nAfter activation you may login to %s using the following username and password:\\n\\nUsername: %s\\nPassword: %s', '/Applications/XAMPP/xamppfiles/htdocs/sealite/language/en-GB/en-GB.com_users.ini'),
(306, 'COM_USERS_EMAIL_REGISTERED_WITH_ACTIVATION_BODY_NOPW', 'Hello %s,\\n\\nThank you for registering at %s. Your account is created and must be activated before you can use it.\\nTo activate the account click on the following link or copy-paste it in your browser:\\n%s \\n\\nAfter activation you may login to %s using the following username and the password you entered during registration:\\n\\nUsername: %s', '/Applications/XAMPP/xamppfiles/htdocs/sealite/language/en-GB/en-GB.com_users.ini'),
(307, 'COM_USERS_EMAIL_REGISTERED_WITH_ADMIN_ACTIVATION_BODY', 'Hello %s,\\n\\nThank you for registering at %s. Your account is created and must be verified before you can use it.\\nTo verify the account click on the following link or copy-paste it in your browser:\\n %s \\n\\nAfter verification an administrator will be notified to activate your account. You''ll receive a confirmation when it''s done.\\nOnce that account has been activated you may login to %s using the following username and password:\\n\\nUsername: %s\\nPassword: %s', '/Applications/XAMPP/xamppfiles/htdocs/sealite/language/en-GB/en-GB.com_users.ini');
