(1889, 'MOD_RELATED_XML_DESCRIPTION', 'This Module displays other Articles that are related to the one currently being viewed. These relations are established by the Meta Keywords. <br />All the keywords of the current Article are searched against all the keywords of all other published Articles. For example, you may have an Article on "Breeding Parrots" and another on "Hand Raising Black Cockatoos". If you include the keyword "parrot" in both Articles, then the Related Items Module will list the "Breeding Parrots" Article when viewing "Hand Raising Black Cockatoos" and vice-versa.', '/Applications/XAMPP/xamppfiles/htdocs/sealite/language/en-GB/en-GB.mod_related_items.ini'),
